&quot;Hmm... were you that happy? Your horn's out.&quot;

A demon girl who doesn't look good on her beautiful face and has been caught by a sadistic extermination shop, Mutsumi. I was tired of being given a strange name, &quot;Tama&quot;, and being forced to take care of the inactive Mutsumi and help exterminate evil spirits.

One day, when Mutsumi tries to escape secretly to the sleeping plow―Mutsumi who woke up pushed her down! ?? 

&quot;Sensitivity seems to be good... I'll try it.&quot; 

The &quot;mating&quot; that I experienced for the first time made me so confused that my transformation could be unraveled... Even though I'm usually better than a demon, I didn't know that I could make such a face!

A sarcastic, beautiful and strong exorcist x a positive demon, cross-species sword couple's journey!

